ControlPropertyState.AutoRuleBindingString:
Text(
If(
    IsBlank(
        Value(
            First(
                SortByColumns(
                    Filter(
                        Controle_Entrada_Arquivos,
                        Referencia = DataCardValue1.Text
                    ),
                    "Revisao",
                    SortOrder.Descending
                )
            ).Revisao
        )
    ),
    0,
    Value(
        First(
            SortByColumns(
                Filter(
                    Controle_Entrada_Arquivos,
                    Referencia = DataCardValue1.Text
                ),
                "Revisao",
                SortOrder.Descending
            )
        ).Revisao
    ) + 1
),"00")

"<div style='
  background:#fff;
  border-radius:10px;
  box-shadow:0 1px 4px rgba(44,62,80,0.10);
  padding:5px 5px;
  margin-left:5px;
  margin-right:20px;
  display:flex;
  flex-direction:column;
  font-family:Segoe UI, Arial, sans-serif;
  font-size:11px;
  color:#273651;
'>

  <!-- 1 linha: Arquivo, Assunto, Status, Boto -->
  <div style='display:flex; flex-wrap:wrap; gap:5px; margin-bottom:6px; align-items:flex-start;'>
    <!-- ARQUIVO -->
    <div style='flex:1 1 25%; display:flex; flex-direction:column;'>
      <span style='font-weight:600; color:#2258a5; font-size:11px; display:flex; align-items:center; gap:2px;'>
        Arquivo:
        <span style='font-weight:700; color:#222;'> " & ThisItem.Referencia & "</span>
      </span>
    </div>
    <!-- ASSUNTO -->
    <div style='flex:2 1 45%; display:flex; flex-direction:column;'>
      <span style='font-weight:600; color:#3182ce; font-size:11px; display:flex; align-items:center; gap:2px;'>
        Assunto:
        <span style='font-weight:700; color:#222;'> " & Upper(ThisItem.Assunto) & "</span>
      </span>
    </div>
    <!-- STATUS -->
    <div style='flex:1 1 20%; display:flex; flex-direction:column;'>
      <span style='font-weight:600; color:#387c37; font-size:11px; display:flex; align-items:center; gap:2px;'>
        Status:
        <span style='
          background:#e6f8e4;
          color:#2b6844;
          border-radius:5px;
          padding:1.5px 7px;
          font-size:11px;
          font-weight:700;
          display:inline-block;
        '>
          " & ThisItem.Status.Value & "
        </span>
      </span>
    </div>
    <!-- BOTO DOWNLOAD -->
    <div style='margin-left:auto; display:flex; align-items:center;'>
      <div style='
        background:#d0e6ff;
        color:#1a4e8a;
        padding:4px 10px;
        border-radius:5px;
        font-weight:600;
        font-size:11px;
        width:80px;
        text-align:center;
      '> Baixar</div>
    </div>
  </div>

  <!-- 2 linha: Disciplina, Analista, Etapa, Boto -->
  <div style='display:flex; flex-wrap:wrap; gap:5px; margin-bottom:6px; align-items:flex-start;'>
    <!-- DISCIPLINA -->
    <div style='flex:2 1 25%; display:flex; flex-direction:column;'>
      <span style='font-weight:600; color:#174d36; font-size:11px; display:flex; align-items:center; gap:2px;'>
        Disciplina:
        <span style='color:#222;'> " & ThisItem.Disciplina.Value & "</span>
      </span>
    </div>
    <!-- ANALISTA -->
    <div style='flex:2 1 45%; display:flex; flex-direction:column;'>
      <span style='font-weight:600; color:#b93d6c; font-size:11px; display:flex; align-items:center; gap:2px;'>
        Analista:
        <span style='color:#222;'> " & ThisItem.Analista & "</span>
      </span>
    </div>
    <!-- ETAPA -->
    <div style='flex:1 1 20%; display:flex; flex-direction:column;'>
      <span style='font-weight:600; color:#254d90; font-size:11px; display:flex; align-items:center; gap:2px;'>
        Etapa:
        <span style='color:#254d90;'> " & ThisItem.Etapa.Value & "</span>
      </span>
    </div>
    <!-- BOTO CONCLUIR -->
    <div style='margin-left:auto; display:flex; align-items:center;'>
      <div style='
        background:#c7f5d2;
        color:#1c7430;
        padding:4px 10px;
        border-radius:5px;
        font-weight:600;
        font-size:11px;
        width:80px;
        text-align:center;
      '> Concluir</div>
    </div>
  </div>

  <!-- 3 linha: Entrada, Reviso, Dias, Boto -->
  <div style='display:flex; flex-wrap:wrap; gap:5px; align-items:flex-start;'>
    <!-- ENTRADA -->
    <div style='flex:1 1 25%; display:flex; flex-direction:column;'>
      <span style='font-weight:600; color:#1d3359; font-size:11px; display:flex; align-items:center; gap:2px;'>
        Entrada:
        <span style='color:#1d3359;'> " & If(
          !IsBlank(ThisItem.Data_entrada),
          Text(ThisItem.Data_entrada, "[$-pt-BR]dd/mm/yyyy"),
          "<span style=\'color:#b0b0b0; font-style:italic;\'>-</span>"
        ) & "</span>
      </span>
    </div>
    <!-- REVISO -->
    <div style='flex:1 1 45%; display:flex; flex-direction:column;'>
      <span style='font-weight:600; color:#7847b8; font-size:11px; display:flex; align-items:center; gap:2px;'>
        Reviso:
        <span style='color:#7847b8;'> R" & Text(ThisItem.Revisao,"00") & "</span>
      </span>
    </div>
    <!-- DIAS -->
    <div style='flex:1 1 20%; display:flex; flex-direction:column;'>
      <span style='font-weight:600; color:#e47b1a; font-size:11px; display:flex; align-items:center; gap:2px;'>
        Dias:
        <span style='color:#e47b1a;'> " & If(ThisItem.Status.Value = "Em anlise", DateDiff(ThisItem.Data_entrada, Today(), TimeUnit.Days), ThisItem.Dias) & "</span>
      </span>
    </div>
    <!-- BOTO EDITAR -->
    <div style='margin-left:auto; display:flex; align-items:center;'>
      <div style='
        background:#fde5f0;
        color:#a02a57;
        padding:4px 10px;
        border-radius:5px;
        font-weight:600;
        font-size:11px;
        width:80px;
        text-align:center;
      '> Editar</div>
    </div>
  </div>

</div>"
